import React from 'react';

function BodyProject() {
  return (
    <div>
      <h1>Đây là một tiêu đề</h1>
      <p>Đây là một đoạn văn bản.</p>
      <ul>
        <li>Mục 1</li>
        <li>Mục 2</li>
        <li>Mục 3</li>
      </ul>
    </div>
  );
}

export default BodyProject;
